import React, {Component} from 'react';
import './components/login/styles.scss';

class Login extends Component{
  render(){
    return (
    	<div className="header">
    		<div className="Logo">
    			<img alt="logo" src="https://media.licdn.com/dms/image/C4E0BAQFEytJiVBb7iQ/company-logo_200_200/0?e=2159024400&v=beta&t=LLn7VJVAc66HoioXbsOxuBb_Ye5mONuTbPoMCSycJTw"/>
    		</div>
    	</div>
  );
  }
}

export default Login;
